import React from 'react';
import '../styles/Admin.css';
import trash from "../assets/trash.svg"

const buttonList = {
    "users": {usersButton},
    "songs": {songsButton},
    "artists": {artistsButton},
    "graphs": {graphsButton}
}


const pressed = (button) => {
    const pressedButton = document.getElementById(button);
    if (pressedButton.classList.contains("pressed")){
        pressedButton.classList.remove("pressed");
    } else {
        pressedButton.classList.add("pressed");
    }
}
 
export default function Admin() {
  return (
    <div className="admin-container">
      <aside className="sidebar">
        <button onClick={() => pressed("users")} id='users' className="sidebar-btn">Usuarios</button>
        <button onClick={() => pressed("songs")} id='songs' className="sidebar-btn">Canciones</button>
        <button onClick={() => pressed("artists")} id='artists' className="sidebar-btn">Artistas</button>
        <button id='graphs' className="sidebar-btn">Graficos</button>
      </aside>

      <main className="main-content">
        <h2 className="admin-header">Panel de admin</h2>
            <div className="admin-table">
                <input type="text" placeholder="Buscar..." className="admin-input" />
                <div className="admin-row">
                    <img src="https://via.placeholder.com/50" alt="Usuario" className="row-img" />
                    <h3 className="row-name">Nombre del Usuario</h3>
                    <p className="row-info">Descripci√≥n breve o rol</p>
                    <button className='row-trash'><img src={trash}></img></button>
                </div>
                
            </div>
      </main>
    </div>
  );
}
